import User from "../../../Domain/Aggregate/User/user";
import { CreateUserModel } from "../../../ViewModel/UserViewModel/CreateUSerViewModel";
import { UserModel, UserDoc } from '../../Contenxt/User';
import { IUserRepository } from "./IUserRepository";
import bcrypte from 'bcrypt';
import OperationResult from "@nodeidentity/common/build/core/operation/Operation";

export default class UserRepository implements IUserRepository {

    async CreateUser(userModel: CreateUserModel): Promise<OperationResult<UserDoc>> {

        let password = await bcrypte.hash(userModel.password, 5);
        let user = new User(userModel.firstName, userModel.lastName, userModel.email, password, userModel.gender);
        let addUserModel = await UserModel.build({
            confirmEmail: user.ConfirmEmail,
            accountFail: user.Accountfail,
            email: user.email,
            firstName: user.firstName,
            gender: user.Gender,
            isActive: user.isActive,
            isAdmin: user.isActive,
            lastName: user.lastName,
            locked: user.Locked,
            password: user.password,
            securityStamp: user.SecurityStamp,
            lockedDate: user.LockedDate
        });
        return new Promise<any>((resolve, reject) => {
            addUserModel.save()
                .then(data => {
                    resolve(OperationResult.BuildSuccessResult('operation result', data));
                })
                .catch(error => {
                    reject(OperationResult.BuildFailur(error.toString()));
                })
        })

    }

}

export default class User {

    //#region BackingField 
    private _firstName: string;
    private _lastName: string;
    private _email: string;
    private _password: string;
    private __isAdmin: boolean;
    private _isActive: boolean;
    private _confirmEmail: boolean;
    private _gender: number;
    private _locked: boolean;
    private _lockedDate?: Date;
    private _accountFail: number;
    private _securityStamp: string;
    //#endregion
    //#region getter setter
    public get firstName(): string {
        return this._firstName;
    }
    public set firstName(value: string) {
        this._firstName = value;
    }
    public get lastName(): string {
        return this._lastName;
    }
    public set lastName(value: string) {
        this._lastName = value;
    }
    public get email(): string {
        return this._email;
    }
    public set email(value: string) {
        this._email = value;
    }
    public get password(): string {
        return this._password;
    }
    public set password(value: string) {
        this._password = value;
    }
    public get isAdmin(): boolean {
        return this.__isAdmin;
    }
    public set isAdmin(value: boolean) {
        this.__isAdmin = value;
    }
    public get isActive(): boolean {
        return this._isActive;
    }
    public set isActive(value: boolean) {
        this._isActive = value;
    }
    public get Gender(): number {
        return this._gender;
    }
    public set Gender(value: number) {
        this._gender = value;
    }
    public get Locked(): boolean {
        return this._locked;
    }
    public set Locked(value: boolean) {
        this._locked = value;
    }
    public get LockedDate(): Date | undefined {
        return this._lockedDate;
    }
    public set LockedDate(value: Date | undefined) {
        this._lockedDate = value;
    }
    public get Accountfail(): number {
        return this._accountFail;
    }
    public set Accountfail(value: number) {
        this._accountFail = value;
    }
    public get SecurityStamp(): string {
        return this._securityStamp;
    }
    public set Securotystamp(value: string) {
        this._securityStamp = value;
    }
    public get ConfirmEmail(): boolean {
        return this._confirmEmail;
    }
    public set ConfirmEmail(value: boolean) {
        this._confirmEmail = value;
    }
    //#endregion

    constructor(
        firstName: string,
        lastName: string, email: string,
        password: string, gender: number,
        isAdmin: boolean = false,
        isActive: boolean = false) {

        this._firstName = firstName;
        this._lastName = lastName;
        this._email = email;
        this._password = password;
        this.__isAdmin = isAdmin;
        this._isActive = isActive;
        this._gender = gender;
        this._locked = false;
        this._confirmEmail = false;
        this._lockedDate = undefined;
        this._accountFail = 0;
        this._securityStamp = (new Date()).getTime().toString(36) + Math.random().toString(36).slice(2);
    }

    UpdateSecuirtyStamp() {
        this._securityStamp = (new Date()).getTime().toString(36) + Math.random().toString(36).slice(2);
    }

    LockedEnabled() {
        this._locked = true;
        this._lockedDate = new Date(Date.now() + 5 * 24 * 60 * 60 * 1000);
        this.UpdateSecuirtyStamp();
    }

    ConfirmedEmail() {
        this._confirmEmail = true;
        this.UpdateSecuirtyStamp();
    }

    ChangeLockEndStatus(status: boolean) {
        this._locked = !status;
    }

    ChangeEmail(email: string) {
        this._email = email;
        this.UpdateSecuirtyStamp();
        this._confirmEmail = false;
    }

    ChangeUserActiveStatus(status: boolean) {
        this._isActive = !status;
    }

    ChangePassword(password: string) {
        this._password = password;
        this.UpdateSecuirtyStamp();
    }

}

import mongoose from 'mongoose';

enum Gender {
    Male = 1,
    Female = 2,
    Trans = 3
}

interface UserAttrs {
    firstName: string;
    lastName: string;
    email: string;
    password: string;
    isAdmin: boolean;
    isActive: boolean;
    confirmEmail: boolean;
    gender: number;
    locked: boolean;
    lockedDate?: Date;
    accountFail: number;
    securityStamp: string;
}

export interface UserDoc extends mongoose.Document {
    firstName: string;
    lastName: string;
    email: string;
    password: string;
    isAdmin: boolean;
    isActive: boolean;
    confirmEmail: boolean;
    gender: string;
    locked: boolean;
    lockedDate?: Date;
    accountFail: number;
    securityStamp: string;
}

interface UserModel extends mongoose.Model<UserDoc> {
    build(userAttrs: UserAttrs): UserDoc;
}

const UserSchema = new mongoose.Schema({
    firstName: {
        type: String,
        required: true
    },
    lastName: {
        type: String,
        required: true
    },
    email: {
        type: String,
        required: true
    },
    password: {
        type: String,
        required: true
    },
    isAdmin: {
        type: Boolean,
        required: true
    },
    isActive: {
        type: Boolean,
        required: true
    },
    confirmEmail: {
        type: Boolean,
        required: true
    },
    gender: {
        required: true,
        type: Object.values(Gender)
    },
    securityStamp:{
        type:String,
        required: true
    },
    accountFail:{
        type:Number,
        required: true
    },
    lockedDate:{
        type:Date
    },
    locked:{
        type:Boolean,
        required: true
    }
})

UserSchema.statics.build = (attrs: UserAttrs) => {
    return new UserModel(attrs);
}

const UserModel = mongoose.model<UserDoc, UserModel>("User", UserSchema);

export { UserModel }
